  - 主动数据汇点可以获取数据
  - 被动数据汇点允许前面的过滤器把结果推进汇点`,frontmatter:{},index:7,start:88,end:99,noteHTML:"",filepath:"/Users/chun/Develop/software-architecture-explained-with-spring/10-pipefilter.md",id:7,no:8},__clicksElements:[],__preloaded:!1}},{path:"9",name:"page-9",component:LE,meta:{slide:{raw:`
